import { Component, OnInit } from '@angular/core';
import { LotFilter } from '../lot-filter';
import { LotService } from '../lot.service';
import { Lot } from '../lot';

@Component({
  selector: 'app-lot',
  templateUrl: 'lot-list.component.html'
})
export class LotListComponent implements OnInit {

  filter = new LotFilter();
  selectedLot!: Lot;
  feedback: any = {};
  lotList:any=[];


  // get lotList(): Lot[] {
  //   return this.lotService.lotList;
  // }

  constructor(private lotService: LotService) {
  }

  ngOnInit() {
    this.reset();
  }

  search(): void {
    this.lotService.load(this.filter);
  }

  reset(): void {
    this.lotService.getList().subscribe(

      {next:(data:any) => {
        console.log(data);
        this.lotList=data ;
      },
      error:(err:any)=> {
        console.error(err); // Log any errors
      }}
    );
  }

  select(selected: Lot): void {
    this.selectedLot = selected;
  }

  delete(lot: Lot): void {
    if (confirm('Are you sure?')) {
      this.lotService.delete(lot).subscribe({
        next: () => {
          this.feedback = {type: 'success', message: 'Delete was successful!'};
          setTimeout(() => {
            this.search();
          }, 1000);
        },
        error: err => {
          this.feedback = {type: 'warning', message: 'Error deleting.'};
        }
      });
    }
  }
}
<ol class="breadcrumb float-right">
  <li class="breadcrumb-item"><a routerLink="/">Home</a></li>
  <li class="breadcrumb-item active">Hotel</li>
</ol>
<div class="card">
  <div class="header">
    <h2 class="title">Hotel List</h2>
  </div>
  <div class="content">
    <form #f="ngForm">

      <button (click)="search()" [disabled]="!f?.valid" class="btn btn-primary">Search</button>
      <a [routerLink]="['../lots', 'new' ]" class="btn btn-default">New</a>
    </form>
  </div>
</div>
<div class="card" *ngIf="lotList.length > 0">
  <div *ngIf="feedback.message" class="alert alert-{{feedback.type}}">{{ feedback.message }}</div>
  <div class="table-responsive">
    <table class="table table-centered table-hover mb-0" id="datatable">
      <thead>
        <tr>
          <th class="border-top-0" scope="col">Id</th>
          <th class="border-top-0" scope="col">Immeuble associé</th>
          <th class="border-top-0" scope="col">Nom</th>
          <th class="border-top-0" scope="col">Propriétaire</th>
          <th class="border-top-0" scope="col" style="width:120px"></th>
        </tr>
      </thead>
      <tbody>
        <tr *ngFor="let item of lotList" [class.active]="item === selectedLot">

          <td>{{item.id}}</td>
          <td>{{item.id_immeuble}}</td>
          <td>{{item.nom}}</td>
          <td>{{item.id_coproprio}}</td>
          <td style="white-space: nowrap">
            <a [routerLink]="['../lots', item.id ]" class="btn btn-secondary">Edit</a>&nbsp;
            <button (click)="delete(item)" class="btn btn-danger">Delete</button>
          </td>
        </tr>
      </tbody>
    </table>
  </div>
</div>
